import time


class Solution:
    def isAnagramBruteForce(self, s: str, t: str) -> bool:
        if len(s) != len(t):
            return False
        for char in s:
            count_s = 0
            count_t = 0

            for i in range(len(s)):
                if char == s[i]:
                    count_s += 1

            for i in range(len(t)):
                if char == t[i]:
                    count_t += 1

            if count_s != count_t:
                return False
        return True

    def isAnagramOptimal(selfs, s: str, t: str) -> bool:
        count = {}

        for char in s:
            count[char] = count.get(char, 0) + 1

        for char in t:
            if char not in count:
                return False

            count[char] = count.get(char, 0) - 1

        for value in count.values():
            if value != 0:
                return False
        return True


